function FinalData(props){
    const userInfo = []
    userInfo.push(props.fname,props.fname, props.mail, props.number)
    userInfo.push(props.devTalks, props.aboutYou, props.speech)

    // console.log(userInfo)
    const arr =['Yes','no', 'Y']

    for(let i=0;i<arr.length;i++){
        if(arr[i]==='Y'||arr[i]==='Yes'){
            arr[i]=true;
        }
        console.log(arr[i])
    }

    return(null)
}
export default FinalData;
